> Texas Cruz nets $12 million for presidential bid, Rubio $6 million In this Oct. 5, 2015, photo, Republican presidential candidate Sen. Ted Cruz, R-Texas, addresses supporters at Kalamazoo Wings stadium in Kalamazoo, Mich. Cruz's presidential campaign is reporting a $12.2 million fundraising boost over the past three months. The Republican Texas senator's new fundraising, added to what he raised through the end of June, gives him a total of $26.5 million since he entered the race in late March. (AP Photo/Carlos Osorio) 
